import React from 'react';
import {
  MdRemoveRedEye,
  MdEdit,
  MdDelete,
  MdFiberManualRecord,
} from 'react-icons/md';
import PropTypes from 'prop-types';
import Popup from 'reactjs-popup';
import { useDispatch } from 'react-redux';

import { Container, Button } from './styles';
import ButtonMore from '../../../components/ButtonMore';
import history from '../../../services/history';
import * as OrderActions from '../../../store/modules/orders/actions';

export default function EntregadoresTabela({ data }) {
  const dispatch = useDispatch();

  function handleDelete() {
    var confirmDelete = window.confirm(
      `Você tem certeza que deseja deletar a encomenda ${data.id}?`
    );

    if (confirmDelete === true) {
      dispatch(OrderActions.deleteRequest(data.id));
    } else {
      history.goBack();
    }
  }
  return (
    <Container>
      <small>#{data.id}</small>
      <small>
        <img src={data.avatar.url} alt="" />
      </small>
      <small>{data.name}</small>
      <small>{data.email}</small>
      <ButtonMore>
        <Button>
          <div>
            <button
              onClick={() => history.push(`/encomenda/${data.id}`)}
              type="button"
            >
              <MdEdit color="#4D85EE" size={10} />
              <span>Editar</span>
            </button>
          </div>
          <div>
            <button onClick={handleDelete} type="button">
              <MdDelete color="#DE3B3B" size={10} />
              <span>Excluir</span>
            </button>
          </div>
        </Button>
      </ButtonMore>
    </Container>
  );
}

EntregadoresTabela.propTypes = {
  data: PropTypes.shape({
    id: PropTypes.number,
    product: PropTypes.string,
    recipient: PropTypes.shape({
      name: PropTypes.string,
      city: PropTypes.string,
      state: PropTypes.string,
    }),
    status: PropTypes.string,
    signature: PropTypes.shape({
      url: PropTypes.string,
    }),
  }).isRequired,
};
